string realinput = "";

string[] inputs =new string[]
{
    "mjqjpqmgbljsphdztnvjfqwrcgsmlb",
    "bvwbjplbgvbhsrlpgdmjqwftvncz",
    "nppdvjthqldpwncqszvftbrmjlhg",
    "nznrnfrfntjfmvfwmzdfjlvtqnbhcprsg",
    "zcfzfwzzqfrljwzlrfnpqdbhtmscgvjw",
    realinput
};

int lengthOfSequence = 14;

foreach (string input in inputs)
{
    Queue<char> lastFour = new Queue<char>();
    int index = 0;
    while (index < input.Length)
    {
        bool fourIsIn = false;
        lastFour.Enqueue(input[index]);
        if (lastFour.Count > lengthOfSequence)
        {
            lastFour.Dequeue();
            fourIsIn = true;
        }

        index++;

        if (fourIsIn)
        {
            bool allunique = true; 
            var fourArray = lastFour.ToArray();
            for (int p = 0; p < lastFour.Count; p++)
            {
                for (int q = p + 1; q < lastFour.Count; q++)
                {
                    if (fourArray[p] == fourArray[q])
                    {
                        allunique = false;
                    }
                }
            }

            if (allunique)
            {
                Console.WriteLine(index);
                break;
            }
        }
    }
}